import React, { useEffect, useState } from "react";
import axios from "axios";
import { useParams } from "react-router-dom";

function Profile() {
  const { id } = useParams();
  const [family, setFamily] = useState([]);

  useEffect(() => {
    axios
      .get("http://localhost:5000/users/family", { withCredentials: true })
      .then((res) => setFamily(res.data));
  }, []);

  return (
    <div>
      <h2>Family Members</h2>
      {family.map((member) => (
        <div key={member._id}>
          {member.role} - {member.name} ({member.age}) - {member.address}
        </div>
      ))}
    </div>
  );
}

export default Profile;
